<html>
    <head>
        <title>Multidimensional array</title>
    </head>
    <body>
        <script>  
         var stu = [
                       ["Rahul","HP", 50],
                       ["Samir","Dell", 20],
                       ["Sumit","Asus", 10],
                    ]; 
        for(let i = 0; i < 3; i++  ){
            for(let j = 0; j<3; j++){
                document.write(stu[i][j] + "");
            }
            document.write("<br>")
        }
        </script>
    </body>
</html>
